import React from 'react'

const NotFound = () => {
  return (
    <div className='notfound'>
      <h1 className='notfound__heading'>404 Not Found</h1>
      <p className='notfound__paragraph'>The page you are looking for does not exist.</p>

    </div>
  )
}

export default NotFound
